import Hero from '../components/Hero';
import Navbar from '../components/Navbar';
import AboutImg from "../assests/anfa.jpg"
function About() {
  return (
    <div>
      <Navbar />
      <Hero
        cName="hero"
        heroImg={AboutImg}
        title="Aboua"
        text=""
        buttonText="Grow your business with us"
        url="/"
        btnClass="show"
      />
    
    </div>
  );
}

export default About;
